import React from 'react';
import {connect} from "react-redux";
import mapStateToProps from "react-redux";

const Game = props => {
        return (
            <div>
                <div>
                    <input value={props.name1} />
                </div>
                <div>
                    <input />
                </div>
            </div>
        );
};

mapStateToProps = (state) => ({
    name1: state.name1,
    name2: state.name2
});

export default connect(mapStateToProps)(Game);
